import { Card } from "react-bootstrap";
import Link from "next/link";
import { delParantheses, convertPol } from "../../../lib/charsConvertion";

const Folder = ({ title, options, category }) => {
  category = convertPol(delParantheses(category));
  category = category
    .split(/[\s/]+/)
    .join("-")
    .toLowerCase();
  return (
    <Card className="folder-card">
      <div className="header">
        <h4>{title}</h4>
      </div>
      <ul>
        {options.map((option) => (
          <Link
            href={`/cudzoziemcy/${category}/[id]`}
            as={`/cudzoziemcy/${category}/${option
              .split(" ")
              .join("-")
              .toLowerCase()}`}
          >
            <li>
              <a className={option}>{option}</a>
              <hr className="folder-separator" />
            </li>
          </Link>
        ))}
      </ul>
    </Card>
  );
};

export default Folder;
